INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "お！\nあそこに困ってそうな人発見！", 0, "春咲 ひより", 1, 2, 1, 1001, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "みんなみたいに\nわたしも強くならなきゃ", "大切な人を\n守れるようになりたい…って", 0, "草野 優衣", 1, 2, 1, 1002, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "フェンシングを始めてみては？", "キミに必要な集中力と感性が", 0, "士条 怜", 1, 2, 1, 1003, "少しは磨かれると思いますよ。", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "ねぇ、にいちゃん！", "今日はなにして遊ぶ？", 0, "穂高 みそぎ", 1, 2, 1, 1004, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 0, 1.5, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "風宮あかりです", "ねぇ…", 0, "風宮 あかり", 1, 2, 1, 1006, "私といっしょに…\nいかない？", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "出雲宮子なのー", "プリンたべたいのー", 0, "出雲 宮子", 1, 2, 1, 1007, "食べ物の恨みは怖いのー", 0, 0, 1.5, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "ボクは虹村雪。", "キミもボクの美貌に\n吸い寄せられたんだね。", 0, "虹村 雪", 1, 2, 1, 1008, "いいよ。\n見られることは運命さ…", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "フッ…聞いて後悔するがいい！", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, "柊杏奈", 1, 2, 1, 1009, "人呼んで「疾風の冥姫」!!", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "マホマホ王国のプリンセス、\nまほ姫どす", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, "姫宮 真歩", 1, 2, 1, 1010, "ほんまおおきにやわ～♪", 0, 0, 1.5, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "衣之咲璃乃です！", "生き別れたお兄ちゃんを探して\n三千世界！", 0, "衣之咲 璃乃", 1, 2, 1, 1011, "ここで会ったが\n100年目～！", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", "ち、超能力って…\n何のことかな～？", 0, "柏崎 初音", 1, 2, 1, 1012, "…って、お願い！\n誰にも言わないでおいて～！", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "ちょす！\n美波鈴奈だよ～♪", "一応カリスマ読モJKやってまっす！", 0, "美波 鈴奈", 1, 2, 1, 1016, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "はいたーい。\n喜屋武香織さー。", "東京は遊園地みたいなところさー", 0, "喜屋武 香織", 1, 2, 1, 1017, "でも、沖縄もとってもいいとこさー", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "支倉伊緒です。", "先生って呼ばれるのは\nくすぐったいから", 0, "支倉 伊緒", 1, 2, 1, 1018, "イオちゃんって呼んでね。", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "あ！/\お兄ちゃ～ん\nまってよ～", 0, "茜 ミミ", 1, 2, 1, 1020, "ミミをおいてかないでぇ～", 0, 0, 1.5, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "あ…あの…えっと…\n栗…林…くるみ…です……", "あの……\nふぇ……", 0, "栗林 くるみ", 1, 2, 1, 1021, "ふぇぇぇぇぇん……", 0, 0, 1.5, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "風宮よりです。\nあああああ！", "こんな私に貴重な時間を\n割いていただき、", 0, "風宮 より", 1, 2, 1, 1022, "なんてありがとうございます！", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "おにいちゃんどこいくの？\nえ？", 0, "北条 綾音", 1, 2, 1, 1023, "私こっち行きたいー\nね、早く早くー", 0, 0, 1.5, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "わっ…わっ…私、\n天野すずめといいます！", "ふ、不束者ですが\nどうぞ末永く…って、", 0, "天野 すずめ", 1, 2, 1, 1025, "これて何か違う…\nあああすみません！", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "……クスクス…私は\n…倉石恵理子……", "あなたは…運命の……\n伴侶……", 0, "倉石 恵理子", 1, 2, 1, 1027, "離しませんわ………\n絶対に…!!", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, "佐々木 咲恋", 1, 2, 1, 1028, "…そうでしょ？？", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "桜井望だよ！\nよろしくねっ", "ぇっと…\nキミ、私のこと知らないの?!", 0, "桜井 望", 1, 2, 1, 1029, "あはは、\n私もまだまだだなぁ～", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "デケデケデンっ！", "初めまして、\n私はニノン・ジュベール申すデス！", 0, "ニノン・ジュベール", 1, 2, 1, 1030, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "上喜しのぶです。\n手元のドクロが父です。", "でもって私の隣にいるのが……\nえ、見えない？", 0, "上喜 しのぶ", 1, 2, 1, 1031, "おかしいですね……", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "目指すはビッグな\nお笑い芸人だっぺ！", "けんども\nそれには足りないモンが…", 0, "野戸まひる", 1, 2, 1, 1033, "そう、\nオラのボケに突っ込める相方が…！", 0, 0, 1.5, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょっと緊張しちゃって…", 0, "綾瀬 ゆかり", 1, 2, 1, 1034, "ちょ\nちょっと一杯飲んできます…！", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "氷川鏡華…です", "知らない人とは話しちゃいけないので", 0, "氷川 鏡華", 1, 2, 1, 1036, "これ以上お話しすることは…\nないです！", 0, 0, 1.5, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "柏崎…栞です。", "……あ、アラーム。", 0, "柏崎 栞", 1, 2, 1, 1038, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "ふ、双葉碧です。", "私、一人も友達がいなくて……", 0, "双葉 碧", 1, 2, 1, 1040, "野に咲く花が、\n唯一の話相手です。", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "三角千歌です。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, "三角 千歌", 1, 2, 1, 1042, "そう思っています。", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "安芸真琴だ。", "あぁ？\nお前のそいつの仲間か？", 0, "安芸 真琴", 1, 2, 1, 1043, "う、疑ってすまなかったな…", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "わらわこそは夜を総べる者！", "生けとし生ける全ての者よ！", 0, "イリヤ・オーンスタイン", 1, 2, 1, 1044, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "そこで騎士は妖精を乱暴に……", "ぐふふふふ……はっ！", 0, "遠見 空花", 1, 2, 1, 1045, "ｌク、クウカに何かご用ですか!?", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, "宮坂たまき", 1, 2, 1, 1046, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "大神美冬よ！", "それでは早速クエストに…", 0, "大神 美冬", 1, 2, 1, 1048, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "星野静流だよ！", "クエストもバトルも\n掃除も洗濯も", 0, "星野静流", 1, 2, 1, 1049, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "アタシは玉泉美咲。", "見ての通りの\nセクシー美少女で", 0, "玉泉美咲", 1, 2, 1, 1050, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 0, 1.5, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "？？？", "？？？？", 0, "リマ", 1, 2, 1, 1052, "？？？？", 0, 0, 1.4, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 0, "モニカ・ヴァイスヴィント", 1, 2, 1, 1053, "そ、そこまでいうなら\nもらってやる", 0, 0, 1.5, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 0, "ペコリーヌ", 1, 2, 1, 1058, "そ、そこまでいうなら\nもらってやる", 0, 0, 1.5, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 0, "コッコロ", 1, 2, 1, 1059, "そ、そこまでいうなら\nもらってやる", 0, 0, 1.5, 0, 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 0, "キャル", 1, 2, 1, 1060, "そ、そこまでいうなら\nもらってやる", 0, 0, 1.5, 0, 1);
